import React from "react";

function Singup(props) {
  return (
    <div>
      <h1>회원가입</h1>
      <form>
        <label>이름</label>
        <input type="text" placeholder="NAME" />
        <label>이메일</label>
        <input type="email" placeholder="EMAIL" />
        <label>비밀번호</label>
        <input type="text" placeholder="PASSWORD" />
      </form>
    </div>
  );
}

export default Singup;
